import "./App.css";
import React from "react";

function App() {
    return (
        <div>
            <Head>
                <title>Test</title>
            </Head>
            <h1>Welcome</h1>
            <button onClick={connectWalletHandler}>Connect Wallet</button>
            <button onClick={loadNFTHandler}>Load NFTs</button>
        </div>
    );
}

export default App;
